Here's a basic JavaScript function to sort a table by a specific column:

```javascript
function sortTableByColumn(table, column, asc = true) {
  const dirModifier = asc ? 1 : -1;
  const tBody = table.tBodies[0];
  const rows = Array.from(tBody.rows);

  // Sorting the rows based on the content of the cells in the column
  rows.sort((rowA, rowB) => {
    const a = rowA.cells[column].textContent.trim();
    const b = rowB.cells[column].textContent.trim();

    if (a > b) {
      return 1 * dirModifier;
    } else if (a < b) {
      return -1 * dirModifier;
    } else {
      return 0;
    }
  });

  // Removing and re-adding the rows so the browser re-renders the table
  while (tBody.firstChild) {
    tBody.removeChild(tBody.firstChild);
  }

  tBody.append(...rows);

  // Remember how the column is currently sorted
  table.querySelectorAll('th').forEach(th => th.classList.remove('th-sort-asc', 'th-sort-desc'));
  table.rows[0].cells[column].classList.toggle('th-sort-asc', asc);
  table.rows[0].cells[column].classList.toggle('th-sort-desc', !asc);
}
```

Here's how you can use the function to sort the table by the first column when the first header is clicked:

```javascript
document.querySelector('table').addEventListener('click', (e) => {
  if (e.target.tagName === 'TH') {
    const table = e.target.closest('table');
    const column = Array.prototype.indexOf.call(e.target.parentNode.children, e.target);
    const asc = !e.target.classList.contains('th-sort-asc');

    sortTableByColumn(table, column, asc);
  }
});
```

This code will sort the table by the clicked column in ascending order if the column is not sorted, or in descending order if it is already sorted in ascending order. The table headers will also be updated to reflect the current sort order. 

